import React, { Component } from 'react';
import './links.css';

class Links extends Component {
  navigateTo(page) {
    window.location.href = page;
  }

  render() {
    // document.getElementById('linksBtn').selected = true;
    let linksBtn = document.getElementById('linksBtn');
    console.log(linksBtn);

    return (
      <div id="links-page-container">
        <p>
          My Links:
        </p>
        <p>
          <a href='https://www.linkedin.com/in/natwag/'>LinkedIn Profile</a>
        </p>
        <p>
          <a href='https://github.com/nat82alie'>GitHub Profile</a>
        </p>
      </div>
    );
  }
}

export default Links;
